import styled from "styled-components";

const AccountStyle = {
    ContainerAccount: styled.div`
    padding-left: 120px;
    `,
    ContainerAbout: styled.div`
    display: flex;
    flex-wrap: wrap;
    margin-bottom: 35px;
    `,
    ContainerImg: styled.div`
    max-width: 320px;
    max-height: 568x;
    margin-right: 50px;
    `,
    AboutMe: styled.div`
    font-size: 25px;
    max-width: 320px;
    `,
    ContainerListTags: styled.ul`
    display: flex;
    > li {
        margin-right: 20px;
    };
    ::last-child {
        margin-right: 0;
    }
    `,
    ItemTags: styled.li`
    padding: 2px 5px;
    border: solid 1px #000074;;
    border-radius: 5px;
    `
}

export default AccountStyle
